dia.org/wiki/Juno_%28spacecraft%29). [Juno is the second spacecraft to orbit Jupiter, after the Galileo orbiter, which orbited from 1995 to 2003](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29). [Unlike all earlier spacecraft sent to the outer planets, Juno is powered by solar panels](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29).logseq____&quot;,536871018]],[logseq____&quot;^15logseq____&quot;,[2503,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871018]],[logseq____&quot;^15logseq____&quot;,[2503,logseq____&quot;^Flogseq____&quot;,224,536871018]],[logseq____&quot;^15logseq____&quot;,[2503,logseq____&quot;^Xlogseq____&quot;,224,536871018]],[logseq____&quot;^15logseq____&quot;,[2503,logseq____&quot;^Vlogseq____&quot;,224,536871018]],[logseq____&quot;^15logseq____&quot;,[2503,logseq____&quot;^Ulogseq____&quot;,224,536871018]],[logseq____&quot;^15logseq____&quot;,[2503,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u65a473e0-2434-43eb-84da-d8b85d2416b6logseq____&quot;,536871018]],[logseq____&quot;^15logseq____&quot;,[2505,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The Leidenfrost effect is a physical phenomenon in which a liquid, close to a surface that is significantly hotter than the liquidlogseq____&apos;s boiling point, produces an insulating vapor layer that keeps the liquid from boiling rapidly.logseq____&quot;,536871019]],[logseq____&quot;^15logseq____&quot;,[2505,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871019]],[logseq____&quot;^15logseq____&quot;,[2505,logseq____&quot;^Flogseq____&quot;,33,536871019]],[logseq____&quot;^15logseq____&quot;,[2505,logseq____&quot;^Xlogseq____&quot;,33,536871019]],[logseq____&quot;^15logseq____&quot;,[2505,logseq____&quot;^Vlogseq____&quot;,33,536871019]],[logseq____&quot;^15logseq____&quot;,[2505,logseq____&quot;^Ulogseq____&quot;,33,53  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
